import '../styles/Seats.css';
import { reservationCookieName } from './Movies';
import { useNavigate } from 'react-router-dom';
import { getCookie } from '../Utilities/cookieUtils';
import { useEffect } from 'react';

function Seats() {
    const navigate = useNavigate();
    console.log(getCookie(reservationCookieName));
    useEffect(() => {
        const reservationCookie = getCookie(reservationCookieName);
        if (!reservationCookie) {
            navigate('/');
        }
    }, [navigate]);
    return (
        <div className="seats">
            <h1 className="title is-2" id="seats-h1-title-2">Select seats</h1>
            <h1 className="title is-4" id="seats-h1-title-4">kjgh</h1>
        </div>
    );
}

export default Seats;
